import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch
} from "react-router-dom";

//File Imports
import Landing from "./Landing/pages/Landing";
import Signin from "./Signin/Pages/Signin";
import Signup from "./Signup/Pages/Signup";
import StudentSignup from "./Signup/Pages/StudentSignup";
import CompanySignup from "./Signup/Pages/CompanySignup";
import Navbar from "./StudentDashboard/Pages/Navbar";
import StudentProfile from "./StudentDashboard/StudentProfiles/Pages/StudentProfile";
import EditStudentProfile from "./StudentDashboard/StudentProfiles/Pages/EditStudentProfile";
//CSS file
import "./App.css";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact>
          <Landing />
        </Route>

        <Route path="/Signin/Pages/Signin" exact>
          <Signin />
        </Route>

        <Route path="/Signup/Pages/Signup" exact>
          <Signup />
        </Route>

        <Route path="/Signup/Pages/StudentSignup" exact>
          <StudentSignup />
        </Route>

        <Route path="/Signup/Pages/CompanySignup" exact>
          <CompanySignup />
        </Route>

        <Route
          path="/StudentDashboard/Pages/Navbar/:email"
          component={Signinform}
          exact
        >
          <Navbar />
        </Route>

        <Route
          path="/StudentDashboard/StudentProfiles/Pages/StudentProfile"
          exact
        >
          <StudentProfile />
        </Route>

        <Route
          path="/StudentDashboard/StudentProfiles/Pages/EditStudentProfile"
          exact
        >
          <EditStudentProfile />
        </Route>

        <Redirect to="/" />
      </Switch>
    </Router>
  );
}

export default App;
